import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <nav className="navbar navbar-expand-lg" style={{ backgroundColor: 'black' }}>
            <div className="container-fluid">
                <a className="navbar-brand" href="#" style={{ fontSize: '1.5rem', color: 'white' }}>Perfumes</a>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav justify-content-end mb-2 mb-lg-0" style={{ width: '100%' }}>
                        <li className="nav-item">
                            <Link className="nav-link" to="/contact" style={{ fontSize: '1.5rem', color: 'white' }}>Contact Us</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/about" style={{ fontSize: '1.5rem', color: 'white' }}>About Us</Link>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
